import HomeScreen from './android/app/src/screens/HomeScreen';
import SignUpScreen from './android/app/src/screens/RegisterScreen';

const Stack = createStackNavigator();

const App = () => {
  return (
    <View>
      <Text>hi</Text>
      <SignUpScreen></SignUpScreen>   
    </View>
  );
};

export default App;
